import React from 'react'
import style from 'styled-components';

const Row = style.div`

    display: flex;

`;


const CardWrapper = style.div`

  background-color: #424040;
  width: 340px;
  border-radius: 12px;


`;

const MoviePoster = style.img`

    height: 327px;
    width: 201.57px;
    border-radius: 0 ;

`

export default function MovieCard() {
    return (
        <div>
            <CardWrapper>
                <Row>
                    <MoviePoster src="/images/panther.jpg" alt="Movie_Poster"/>
                </Row>
            </CardWrapper>
        </div>
    )
}
